    nftarray = shuffle(nftarray);

    //Proxy Elements
    var itemElement = document.getElementsByClassName("item")[0];
    var gridElement = document.getElementsByClassName("grid")[0];
    var loaderElement = document.getElementById("loader");

    //Duplicate Elements
    for (var i = 0; i < nftarray.length - 1; i++) {
        var newItem = itemElement.cloneNode(true);
        gridElement.appendChild(newItem);
    }

    //Apply Images
    for (var i = 0; i < nftarray.length; i++) {
        document.getElementsByClassName("nftimage")[i].setAttribute("data-src", "../assets/nft/" + nftarray[i]);

        var data = nftarray[i].replace(".jpg", "").split("_");
        var item = document.getElementsByClassName("item")[i];
        document.getElementsByClassName("nftnumber")[i].innerText = data[0];

        item.setAttribute("number", data[0]);
        item.setAttribute("tier", data[1]);
        item.setAttribute("flavor", data[2]);
        item.setAttribute("waffle", data[3]);
        if (data[4].includes("iota")) item.setAttribute("iota", data[4]); else item.setAttribute("expression", data[4]);
        if (data.length > 5) item.setAttribute("accessory", data[5]);
        if (data.length > 6) item.setAttribute("accessory", data[5] + " " + data[6]);

        var iota = item.getAttribute("iota");
        var expression = item.getAttribute("expression");
        var accessory = item.getAttribute("accessory");
        var tier = item.getAttribute("tier");
        var flavor = item.getAttribute("flavor");
        var waffle = item.getAttribute("waffle");

        if (iota == "") {iota = "-";}
        if (expression == "") {expression = "-";}
        if (accessory == "") {accessory = "-";}

        document.getElementsByClassName("nftinfotext")[i].innerHTML = "<b>Tier </b>"+tier+"<br><b>Flavor </b>"+flavor+"<br><b>IOTA </b>"+iota+"<br><b>Waffle </b>"+waffle+"<br><b>Expression </b>"+expression+"<br><b>Accessory </b>"+accessory;

    }

    //Initialize Grid
    var grid = new Muuri('.grid', {
        sortData: {
            number: function (item, element) {
                return parseFloat(element.getAttribute('number'));
            },
        },
    });

    //----------------------------------LAZY LOADING-------------------------------------
    var lazyloadImages;

    if ("IntersectionObserver" in window) {
        lazyloadImages = document.querySelectorAll("img");
        var imageObserver = new IntersectionObserver(function (entries, observer) {
            entries.forEach(function (entry) {
                if (entry.isIntersecting) {
                    var image = entry.target;
                    image.src = image.dataset.src;
                    //image.classList.remove("lazy");
                    imageObserver.unobserve(image);
                }
            });
        });

        lazyloadImages.forEach(function (image) {
            imageObserver.observe(image);
        });

    } else {
        var lazyloadThrottleTimeout;
        lazyloadImages = document.querySelectorAll("img");

        function lazyload() {
            if (lazyloadThrottleTimeout) {
                clearTimeout(lazyloadThrottleTimeout);
            }

            lazyloadThrottleTimeout = setTimeout(function () {
                var scrollTop = window.pageYOffset;
                lazyloadImages.forEach(function (img) {
                    if (img.offsetTop < (window.innerHeight + scrollTop)) {
                        img.src = img.dataset.src;
                        //img.classList.remove('lazy');
                    }
                });
                if (lazyloadImages.length == 0) {
                    document.removeEventListener("scroll", lazyload);
                    window.removeEventListener("resize", lazyload);
                    window.removeEventListener("orientationChange", lazyload);
                }
            }, 20);
        }

        document.addEventListener("scroll", lazyload);
        window.addEventListener("resize", lazyload);
        window.addEventListener("orientationChange", lazyload);
    }
    //----------------------------------LAZY LOADING-------------------------------------



    grid.on('layoutEnd', function (items) {
        gridElement.style.top = "0px";
        gridElement.style.visibility = "visible";
        counterContainerElement.style.visibility = "visible";
        sortbyContainerElement.style.visibility = "visible";
        loaderElement.style.display = "none";


        //------------------------Center the items----------------------------
        //Count rows
        // Get all active items.
        var activeItems = grid.getItems().filter(function (item) {
            return item.isActive();
        });
        if (activeItems.length > 0) {
            var css = activeItems[0].getElement().style.transform.split(" ")[1];
            var rows;
            for (var i = 0; i < activeItems.length; i++) {
                if (activeItems[i].getElement().style.transform.split(" ")[1] != css) {
                    rows = i;
                    break;
                }
            }
    
            var gridSize = grid.getElement().offsetWidth;
            var itemSize = window.getComputedStyle(grid.getItem(0).getElement()).width;
            var itemMargin = window.getComputedStyle(grid.getItem(0).getElement()).margin;
            var changeLeft = (gridSize - (rows * parseInt(itemSize))) / 2 - (rows * parseInt(itemMargin));
            for (var i = 0; i < activeItems.length; i++) {
                activeItems[i].getElement().style.left = changeLeft + "px";
            }
        }
        //------------------------Center the items END-------------------------
    });

    //OnChange Apply
    flavorSelect.onchange = function () { filterGrid(grid, this); }
    waffleSelect.onchange = function () { filterGrid(grid, this); }
    iotaSelect.onchange = function () { filterGrid(grid, this); }
    expressionSelect.onchange = function () { filterGrid(grid, this); }
    accessorySelect.onchange = function () { filterGrid(grid, this); }
    typeNumberInput.onchange = function () { filterGrid(grid, this); }

    //Sort
    sortbySelect.onclick = function () {
        if (!sorted) {
            sortbySelect.innerText = "Random";
            sorted = true;
            grid.sort('number');
        } else {
            sortbySelect.innerText = "Number ";
            sorted = false;
            grid.sort(shuffle(grid.getItems()));
        }
    }
    //-------------------------------------------NFT PAGE GRID END----------------------------------------------

